import React from 'react';
import './Card.css';

const Card = ({ name, email, id }) => {
    return(
        <div className ="card">
            <img src={'https://robohash.org/${props.id}?200x200'} alt='robots'></img>
            <div>
                <h2>{props.name}</h2>
                <p>{props.email}</p>
            </div>
        </div>
    );
} 


export default Card;
